import React, { useEffect } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./MainPage.css"; // For custom styles like animations

const MainPage = () => {
  // Use effect hook for handling fade-in animations after page load
  useEffect(() => {
    const elements = document.querySelectorAll('.fadeIn');
    elements.forEach(element => {
      element.classList.add('fadeInVisible');
    });
  }, []);

  return (
    <div className="container">
      {/* Navbar */}
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <a className="navbar-brand" href="#">Store Name</a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item active">
              <a className="nav-link" href="#">Home</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">Categories</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">Offers</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#">Brands</a>
            </li>
          </ul>
        </div>
      </nav>

      {/* Animation Section */}
      <div className="row fadeIn">
        <div className="col text-center">
          <h1>Welcome to Our Store</h1>
          <p>Find the best products with amazing offers.</p>
        </div>
      </div>

      {/* Categories Section */}
      <div className="row category fadeIn">
        <div className="col-12 text-center">
          <h2>Categories</h2>
        </div>
        {["Category 1", "Category 2", "Category 3"].map((category, index) => (
          <div className="col-md-4" key={index}>
            <div className="card">
              <img src={`category${index + 1}.jpg`} className="card-img-top" alt={category} />
              <div className="card-body">
                <h5 className="card-title">{category}</h5>
                <p className="card-text">Description of {category.toLowerCase()}.</p>
              </div>
            </div>
          </div>
        ))}
      </div>

      {/* Offers Section */}
      <div className="row offer fadeIn">
        <div className="col-12 text-center">
          <h2>Special Offers</h2>
        </div>
        {["Offer 1", "Offer 2", "Offer 3"].map((offer, index) => (
          <div className="col-md-4" key={index}>
            <div className="card">
              <img src={`offer${index + 1}.jpg`} className="card-img-top" alt={offer} />
              <div className="card-body">
                <h5 className="card-title">{offer}</h5>
                <p className="card-text">Special deal on product {index + 1}.</p>
              </div>
            </div>
          </div>
        ))}
      </div>

      {/* Brands Section */}
      <div className="row brand fadeIn">
        <div className="col-12 text-center">
          <h2>Our Brands</h2>
        </div>
        {["brand1", "brand2", "brand3", "brand4"].map((brand, index) => (
          <div className="col-md-3" key={index}>
            <img src={`${brand}.jpg`} alt={brand} className="img-fluid" />
          </div>
        ))}
      </div>
    </div>
  );
};

export default MainPage;
